contract UpdateSysParam {
	data {
		Name  string
		Value string
		Conditions string "optional"
	}

    conditions {
		if GetContractByName($Name){
			var params map
			params["Value"] = $Value
			CallContract($Name, params)
		} else {
			warning "System parameter not found"
		}
    }

	action {
		DBUpdateSysParam($Name, $Value, $Conditions)
	}
}

